import { useEffect, useState } from "react";
import axios from "axios";

export default function Productos() {
  const [productos, setProductos] = useState([]);
  const [tipos, setTipos] = useState([]);
  const [form, setForm] = useState({ nombre: "", precio: "", tipo_id: "" });
  const [editingId, setEditingId] = useState(null);

  useEffect(() => {
    fetchProductos();
    fetchTipos();
  }, []);

  const fetchProductos = () => {
    axios.get("http://localhost:4000/api/productos")
      .then(res => setProductos(res.data));
  };

  const fetchTipos = () => {
    axios.get("http://localhost:4000/api/productos")
      .then(res => {
        const tiposUnicos = [...new Map(res.data.map(item => [item["tipo_id"], { id: item.tipo_id, nombre: item.tipo }])).values()];
        setTipos(tiposUnicos);
      });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (editingId) {
      axios.put(`http://localhost:4000/api/productos/${editingId}`, form)
        .then(() => { fetchProductos(); resetForm(); });
    } else {
      axios.post("http://localhost:4000/api/productos", form)
        .then(() => { fetchProductos(); resetForm(); });
    }
  };

  const eliminar = (id) => {
    axios.delete(`http://localhost:4000/api/productos/${id}`)
      .then(() => fetchProductos());
  };

  const editar = (prod) => {
    setForm({ nombre: prod.nombre, precio: prod.precio, tipo_id: prod.tipo_id });
    setEditingId(prod.id);
  };

  const resetForm = () => {
    setForm({ nombre: "", precio: "", tipo_id: "" });
    setEditingId(null);
  };

  return (
    <div>
      <h2>üçî Administraci√≥n de Productos</h2>

      <form onSubmit={handleSubmit}>
        <input placeholder="Nombre" value={form.nombre} onChange={(e) => setForm({ ...form, nombre: e.target.value })} required />
        <input type="number" placeholder="Precio" value={form.precio} onChange={(e) => setForm({ ...form, precio: e.target.value })} required />
        <select value={form.tipo_id} onChange={(e) => setForm({ ...form, tipo_id: e.target.value })} required>
          <option value="">Tipo de producto</option>
          {tipos.map(tipo => (<option key={tipo.id} value={tipo.id}>{tipo.nombre}</option>))}
        </select>
        <button type="submit">{editingId ? "Actualizar" : "Crear"}</button>
      </form>

      <table border="1" cellPadding="10" style={{ marginTop: "20px" }}>
        <thead>
          <tr><th>Producto</th><th>Tipo</th><th>Precio</th><th>Acciones</th></tr>
        </thead>
        <tbody>
          {productos.map(p => (
            <tr key={p.id}>
              <td>{p.nombre}</td>
              <td>{p.tipo}</td>
              <td>${p.precio}</td>
              <td>
                <button onClick={() => editar(p)}>‚úèÔ∏è Editar</button>
                <button onClick={() => eliminar(p.id)}>‚ùå Eliminar</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
